import { Routes, Route, Link } from 'react-router-dom';

import logo from './logo.svg';
import './App.css';

import Header from './Header';

function App() {
  return (
    <div className="App">
      <Header />
        <Routes>
          <Route path='/' element={<Home />}></Route>
        </Routes>
    </div>
  );
}

export default App;
